import React from "react";
import Dropdown from "react-overlays/Dropdown";
import { useParams } from "react-router";

export default function TrelloBoard(){
  const { id } = useParams
  const { name, color } = Request
  fetch(`https://api.trello.com/1/boards/${id}/labels?key=0471642aefef5fa1fa76530ce1ba4c85&token=9eb76d9a9d02b8dd40c2f3e5df18556c831d4d1fadbe2c45f8310e6c93b5c548&name=${name}&color=${color}`, {
  method: 'POST'
})
  .then(response => {
    console.log(
      `Response: ${response.status} ${response.statusText}`
    );
    return response.text();
  })
  .then(text => console.log(text))
  .catch(err => console.error(err));

  return(
    <div>
      <main>
        <form>
          <div className="container_1">
            <div className="item">
              <label>Name</label>
              <input type="text"/>
            </div>
            <div className="item">
              <label>E-mail</label>
              <input type="email"/>
            </div>
            <div className="item">
              <textarea/>
            </div>
          </div>
          <div className="container_2">
            <div className="item">
              <span>Option 1 <input type="checkbox" value="op1"/></span>
              <span>Option 2 <input type="checkbox" value="op2"/></span>
              <span>Option 3 <input type="checkbox" value="op3"/></span>
            </div>
            <div className="item">
            </div>
          </div>
        </form>
      </main>
    </div>
  )
}
